      SUBROUTINE TRISPHERE( CDEN, TRIMAX, TRINUM, TRIXYZ, TRINOR,
     &                       TRICHECK, TRILENGTH)
      IMPLICIT NONE
! this s/r provides a triangulated sphere centered on origin
! and radius 1.0 of a particular density
! hard code spheres provided by MSMS

! density in of a single sphere
! allowed values 1 to
!
!     density	MSMS	faces
!
!    	1  	1	 20
! 	2 	2	 36 
! 	3	3	 56 
!	4	5	 94
!	5	7	156
!	6	9	196
!	7      13	296
!	8      20	488
!	9      30	716
!      10      42      1004
      INTEGER			CDEN, DENSITY
      INTEGER			TRIMAX ! parameter array bound
      INTEGER			TRINUM ! number of triangles
      DOUBLE PRECISION		TRIXYZ(3,3,TRIMAX) ! vertices
      DOUBLE PRECISION		TRINOR(3,3,TRIMAX) ! normals
      DOUBLE PRECISION		TRICHECK(3,10,TRIMAX) ! check points within triangle
      DOUBLE PRECISION		TRILENGTH(TRIMAX) ! maximum dimension of the triangle

      INTEGER			SCOUNT, VCOUNT, XCOUNT
      DOUBLE PRECISION		LEN

! end of decs

      DENSITY = CDEN
      IF (DENSITY.LT.1)  DENSITY = 1
      IF (DENSITY.GT.10) DENSITY = 10

      IF (DENSITY.EQ.1) THEN
        CALL TRISPH01( TRIMAX, TRINUM, TRIXYZ, TRINOR)
      ELSEIF (DENSITY.EQ.2) THEN
        CALL TRISPH02( TRIMAX, TRINUM, TRIXYZ, TRINOR)
      ELSEIF (DENSITY.EQ.3) THEN
        CALL TRISPH03( TRIMAX, TRINUM, TRIXYZ, TRINOR)
      ELSEIF (DENSITY.EQ.4) THEN
        CALL TRISPH04( TRIMAX, TRINUM, TRIXYZ, TRINOR)
      ELSEIF (DENSITY.EQ.5) THEN
        CALL TRISPH05( TRIMAX, TRINUM, TRIXYZ, TRINOR)
      ELSEIF (DENSITY.EQ.6) THEN
        CALL TRISPH06( TRIMAX, TRINUM, TRIXYZ, TRINOR)
      ELSEIF (DENSITY.EQ.7) THEN
        CALL TRISPH07( TRIMAX, TRINUM, TRIXYZ, TRINOR)
      ELSEIF (DENSITY.EQ.8) THEN
        CALL TRISPH08( TRIMAX, TRINUM, TRIXYZ, TRINOR)
      ELSEIF (DENSITY.EQ.9) THEN
        CALL TRISPH09( TRIMAX, TRINUM, TRIXYZ, TRINOR)
       ELSEIF (DENSITY.EQ.10) THEN
        CALL TRISPH10( TRIMAX, TRINUM, TRIXYZ, TRINOR)
      ENDIF

      DO SCOUNT = 1, TRINUM ! go thru triangles
        ! unit vector the trixyz and trinorm
	DO VCOUNT = 1, 3
	  LEN = TRIXYZ(1,VCOUNT,SCOUNT)*TRIXYZ(1,VCOUNT,SCOUNT)+
     &          TRIXYZ(2,VCOUNT,SCOUNT)*TRIXYZ(2,VCOUNT,SCOUNT)+
     &          TRIXYZ(3,VCOUNT,SCOUNT)*TRIXYZ(3,VCOUNT,SCOUNT)
          LEN = SQRT(LEN)
	  TRIXYZ(1,VCOUNT,SCOUNT) = TRIXYZ(1,VCOUNT,SCOUNT)/LEN
	  TRIXYZ(2,VCOUNT,SCOUNT) = TRIXYZ(2,VCOUNT,SCOUNT)/LEN
	  TRIXYZ(3,VCOUNT,SCOUNT) = TRIXYZ(3,VCOUNT,SCOUNT)/LEN
	  LEN = TRINOR(1,VCOUNT,SCOUNT)*TRINOR(1,VCOUNT,SCOUNT)+
     &          TRINOR(2,VCOUNT,SCOUNT)*TRINOR(2,VCOUNT,SCOUNT)+
     &          TRINOR(3,VCOUNT,SCOUNT)*TRINOR(3,VCOUNT,SCOUNT)
          LEN = SQRT(LEN)
	  TRINOR(1,VCOUNT,SCOUNT) = TRINOR(1,VCOUNT,SCOUNT)/LEN
	  TRINOR(2,VCOUNT,SCOUNT) = TRINOR(2,VCOUNT,SCOUNT)/LEN
	  TRINOR(3,VCOUNT,SCOUNT) = TRINOR(3,VCOUNT,SCOUNT)/LEN
	ENDDO
       ! work out the maximum size of the channel
       LEN = (TRIXYZ(1,1,SCOUNT)-TRIXYZ(1,2,SCOUNT))*
     &       (TRIXYZ(1,1,SCOUNT)-TRIXYZ(1,2,SCOUNT)) +
     &       (TRIXYZ(2,1,SCOUNT)-TRIXYZ(2,2,SCOUNT))*
     &       (TRIXYZ(2,1,SCOUNT)-TRIXYZ(2,2,SCOUNT)) +
     &       (TRIXYZ(3,1,SCOUNT)-TRIXYZ(3,2,SCOUNT))*
     &       (TRIXYZ(3,1,SCOUNT)-TRIXYZ(3,2,SCOUNT)) 
       LEN = SQRT(LEN)
       TRILENGTH(SCOUNT) = LEN
       ! 3 to 2
       LEN = (TRIXYZ(1,3,SCOUNT)-TRIXYZ(1,2,SCOUNT))*
     &       (TRIXYZ(1,3,SCOUNT)-TRIXYZ(1,2,SCOUNT)) +
     &       (TRIXYZ(2,3,SCOUNT)-TRIXYZ(2,2,SCOUNT))*
     &       (TRIXYZ(2,3,SCOUNT)-TRIXYZ(2,2,SCOUNT)) +
     &       (TRIXYZ(3,3,SCOUNT)-TRIXYZ(3,2,SCOUNT))*
     &       (TRIXYZ(3,3,SCOUNT)-TRIXYZ(3,2,SCOUNT)) 
       LEN = SQRT(LEN)
       TRILENGTH(SCOUNT) = MAX(LEN,TRILENGTH(SCOUNT))
       ! 3 to 1
       LEN = (TRIXYZ(1,3,SCOUNT)-TRIXYZ(1,1,SCOUNT))*
     &       (TRIXYZ(1,3,SCOUNT)-TRIXYZ(1,1,SCOUNT)) +
     &       (TRIXYZ(2,3,SCOUNT)-TRIXYZ(2,1,SCOUNT))*
     &       (TRIXYZ(2,3,SCOUNT)-TRIXYZ(2,1,SCOUNT)) +
     &       (TRIXYZ(3,3,SCOUNT)-TRIXYZ(3,1,SCOUNT))*
     &       (TRIXYZ(3,3,SCOUNT)-TRIXYZ(3,1,SCOUNT)) 
       LEN = SQRT(LEN)
       TRILENGTH(SCOUNT) = MAX(LEN,TRILENGTH(SCOUNT))
! do extra points
!          1
!          8
!        5   7
!          4
!        9   10
!     2    6    3
       DO XCOUNT = 1, 3
         TRICHECK(XCOUNT,1,SCOUNT) = TRIXYZ(XCOUNT,1,SCOUNT)
! 2
         TRICHECK(XCOUNT,2,SCOUNT) = TRIXYZ(XCOUNT,2,SCOUNT)
! 3
         TRICHECK(XCOUNT,3,SCOUNT) = TRIXYZ(XCOUNT,3,SCOUNT)
! 4
         TRICHECK(XCOUNT,4,SCOUNT) = ( TRICHECK(XCOUNT,1,SCOUNT)+ 
     &                                 TRICHECK(XCOUNT,2,SCOUNT)+
     &                                 TRICHECK(XCOUNT,3,SCOUNT)  )/3.0
! 5
         TRICHECK(XCOUNT,5,SCOUNT) = ( TRICHECK(XCOUNT,1,SCOUNT)+ 
     &                                 TRICHECK(XCOUNT,2,SCOUNT)  )/2.0
! 6
         TRICHECK(XCOUNT,6,SCOUNT) = ( TRICHECK(XCOUNT,2,SCOUNT)+ 
     &                                 TRICHECK(XCOUNT,3,SCOUNT)  )/2.0
! 7
         TRICHECK(XCOUNT,7,SCOUNT) = ( TRICHECK(XCOUNT,1,SCOUNT)+ 
     &                                 TRICHECK(XCOUNT,3,SCOUNT)  )/2.0
! 8
         TRICHECK(XCOUNT,8,SCOUNT) = ( TRICHECK(XCOUNT,4,SCOUNT)+ 
     &                                 TRICHECK(XCOUNT,1,SCOUNT)  )/2.0
! 9
         TRICHECK(XCOUNT,9,SCOUNT) = ( TRICHECK(XCOUNT,4,SCOUNT)+ 
     &                                 TRICHECK(XCOUNT,2,SCOUNT)  )/2.0
! 10
         TRICHECK(XCOUNT,10,SCOUNT)= ( TRICHECK(XCOUNT,4,SCOUNT)+ 
     &                                 TRICHECK(XCOUNT,3,SCOUNT)  )/2.0
        ENDDO ! go thru x, y, z
   
        DO VCOUNT = 1, 10
	  LEN = TRICHECK(1,VCOUNT,SCOUNT)*TRICHECK(1,VCOUNT,SCOUNT)+
     &          TRICHECK(2,VCOUNT,SCOUNT)*TRICHECK(2,VCOUNT,SCOUNT)+
     &          TRICHECK(3,VCOUNT,SCOUNT)*TRICHECK(3,VCOUNT,SCOUNT)
          LEN = SQRT(LEN)
	  TRICHECK(1,VCOUNT,SCOUNT) = TRICHECK(1,VCOUNT,SCOUNT)/LEN
	  TRICHECK(2,VCOUNT,SCOUNT) = TRICHECK(2,VCOUNT,SCOUNT)/LEN
	  TRICHECK(3,VCOUNT,SCOUNT) = TRICHECK(3,VCOUNT,SCOUNT)/LEN
	ENDDO     
      ENDDO ! go thru 



      RETURN
      END
!
